import { Button } from '@mui/material'
import React from 'react'

const Buttin = () => {
  return (
    <div>
        <Button color='success' sx={{margin:'3px'}} variant='contained'>Fist</Button>
        <Button color="error" sx={{margin:'3px'}} variant='outlined'>Second</Button>
        <Button sx={{margin:'3px'}} variant='text'>Third</Button>
    </div>
  )
}

export default Buttin
